el Image'}, 'developerAttribution': 'Sloclap', '_type': 'Diesel Product About', 'publisherAttribution': 'Sloclap', 'description': "# New content available | Enter the Arenas
Itching for some more good ol' Kung Fu action? The Arenas free expansion adds an entirely new game mode, featuring 15 dynamic locations and 120 challenges that will put your Kung Fu to the test! Gear up for spectacular combats, brutal opponents, and endless opportunities to refine your moves.

# Is one life enough to know Kung Fu? 
Whether you choose to play as a male or a female character, in Sifu, you will ponder that question on your path for revenge, hunting down your family’s assassins. One against all, you have no allies, countless enemies, and a mysterious amulet to bring you back to life every time you die. Yet, be warned! Your secret weapon comes with a hefty price to pay: aging and its consequences. 

# Learning by fire 
Your enemies don’t wait their turn, and they don’t broadcast their intent. Dodge, parry, strike, use combos and be like water making its way through captivating environments. Learn how to master your art, whether by fighting through the underbelly of a nightclub, scrambling through a refined gallery to avoid getting surrounded, or vertically navigating a towering office building.

# Adaptation is survival
Careful positioning and clever use of the environment to your advantage are key to your survival. Use everything at your disposal: throwable objects, makeshift weapons, windows, and ledges. The odds are stacked against you, and you will be offered no mercy.

# Training never ends
Kung Fu is mastery through practice, a path for both the body and the mind. Learn from your errors, unlock unique skills, and find the strength within yourself to master the devastating techniques of Pak-Mei Kung Fu.

![sifu Image](https://cdn2.unrealengine.com/egs-sifustandardedition-sloclap-g2-00-700x815-94e54c8030a7.jpg)", 'shortDescription': 'Sifu is a realistic third-person brawler with tight Kung Fu combat mechanics and cinematic martial arts action embarking you on a path for revenge.', 'title': 'SIFU', 'developerLogo': {'_type': 'Diesel Image'}}, 'banner': {'showPromotion': False, '_type': 'Epic Store Product Banner', 'link': {'_type': 'Diesel Link'}, 'description': ''}, 'hero': {'logoImage': {'src': 'https://cdn2.unrealengine.com/egs-greeneye-sloclap-ic1-400x400-7f5493d6af29.png', '_type': 'Diesel Image'}, 'portraitBackgroundImageUrl': 'https://cdn2.unrealengine.com/egs-sifustandardedition-sloclap-s4-1200x1600-adb63e705b79.jpg', '_type': 'Diesel Hero', 'action': {'_type': 'Diesel Action'}, 'video': {'loop': False, '_type': 'Diesel Video', 'hasFullScreen': False, 'hasControls': False, 'muted': False, 'autoplay': False}, 'isFullBleed': False, 'altContentPosition': False, 'backgroundImageUrl': 'https://cdn2.unrealengine.com/egs-sifustandardedition-sloclap-s3-2560x1440-dce5ab087b4c.jpg'}, 'carousel': {'_type': 'Diesel Carousel', 'items': [{'image': {'_type': 'Diesel Image'}, '_type': 'Diesel Carousel Item - Image OR Video', 'video': {'recipes': '{
